const TEXT = {
  en: {
    heroTitle: "Naya Andaaz",
    heroSub: "Professional haircuts, makeup & mehendi...",
  },
  hi: {
    heroTitle: "नया अंदाज़",
    heroSub: "प्रोफेशनल हेयरकट, मेकअप और मेहंदी...",
  },
  gu: {
    heroTitle: "નવો અંદાજ",
    heroSub: "પ્રોફેશનલ હેરકટ, મેકઅપ અને મહેંદી...",
  },
};

export default TEXT;
